// src/components/CircularSidebar.js
import React from 'react';
import '../../styles/CircularSidebar.css';

const CircularSidebar = () => {
  return (
    <div className="circular-sidebar">
      <div className="left-sidebar">
        <Link to="/lessons" className="circle-button">Lessons</Link>
        <Link to="/quiz" className="circle-button">Quiz</Link>
        <Link to="/login" className="circle-button">Login</Link>
        <Link to="/register" className="circle-button">Register</Link>
      </div>
    </div>
  );
};

export default CircularSidebar;
